import Card from './Card';
import sdata from './Sdata';



const App = () => {
  return (
    <>
      <h1 className="heading_style">List of Top 5 Netflix Series in 2020</h1>
      {sdata.map(function cval(val) {
        return (
          <Card
            key={val.id}
            name={val.name}
            imgsrc={val.imgsrc}
            title={val.title}
            link={val.link}
          />
        );
      })}
    </>
  );
};
export default App;
